.boombox-section {
    position: absolute;
    left: 0;
    top: 0;
    width: 100%;
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
}
.boom-topline {
    grid-area: topline;
    border-bottom: @1px solid rgba(255, 255, 255, 0.05);
    display: flex;
    align-items: center;
    justify-content: center;
    &>button {
        padding: 0 @30px;
        display: flex;
        align-items: center;
        justify-content: center;
        border-left: @1px solid rgba(255, 255, 255, 0.05);
        height: 100%;
        width: @200px;
        cursor: pointer;
        .anim;
        &:not(:disabled):hover {
            img {
                opacity: 1;
            }  
            background: rgba(255, 255, 255, 0.034);
        }
        &:not(:disabled):active {
            background: rgba(255, 255, 255, 0.1);
        }
        img {
            width: @20px;
            height: @20px;
            margin-right: @16px;
            .anim;
            opacity: .4;
        }
        p {
            font-style: normal;
            font-weight: normal;
            font-size: @18px;
            line-height: 100%;
            color: #FFFFFF;
        }
    }
}
.boom-playlist {
    grid-area: playlist;
    display: flex;
    flex-direction: column;
    align-items: flex-start;
    justify-content: flex-start;
    position: relative;
    overflow: auto;
    border-right: @1px solid rgba(255, 255, 255, 0.05);
}
.boom-content {
    grid-area: content;
    overflow: auto;
    padding: @60px @60px 0 @60px;
    display: flex;
    align-items: center;
    justify-content: flex-start;
}
.boom-botline {
    grid-area: botline;
}
.boombox-wrapper {
    width: @1200px;
    height: @800px;
    background: rgba(20, 27, 31, 0.97);
    border-radius: @6px;
    display: grid;
    grid-template-areas: 'topline topline'
    'playlist content'
    'botline botline';
    grid-template-columns: @400px 1fr;
    grid-template-rows: @80px 1fr @110px;
    &>div {
        position: relative;
    }
    .boombox-take {
        position: absolute;
        left: 50%;
        top: 0;
        transform: translate(-50%,150%);
        padding: @16px @24px;
        border-radius: @200px;
        background: rgba(20, 27, 31, 0.97);;
        color: #fff;
        text-transform: uppercase;
        font-size: @14px;
        display: flex;
        letter-spacing: @2px;
        .anim;
        &:hover {
            background: #f04d26;
        }
    }
}
.boom-input {
    width: 100%;
    height: 100%;
    position: relative;
    display: flex;
    align-items: center;
    justify-content: center;

    &>input {
        font-weight: normal;
        font-size: @18px;
        line-height: 100%;
        color: #FFFFFF;
        display: flex;
        align-items: center;
        justify-content: flex-start;
        padding: 0;
        padding-left: @120px - @4px;
        width: 100%;
        height: 100%;
        background: transparent;
        box-shadow: 0;
        border: 0;
        .anim;
        &:disabled {
            &:hover {
                background: transparent;
            }
            &:focus {
                background: transparent;
            }
        }
        &:hover {
            background: rgba(255, 255, 255, 0.04);
        }
        &:focus {
            background: rgba(255, 255, 255, 0.04);
        }
    }
    .boom-faq {
        position: absolute;
        right: @30px;
        top: 50%;
        transform: translateY(-50%);
        width: @20px;
        height: @20px;
        display: flex;
        justify-content: center;
        align-items: center;
        opacity: .4;
        .anim;
        &:hover {
            opacity: 1;
            cursor: help;
        }

        img {
            width: 100%;
            height: 100%;
        }
    }
}
.boom-music-icons {
    position: absolute;
    left: @30px;
    top: 50%;
    transform: translateY(-50%);
    display: flex;
    align-items: center;
    justify-content: flex-start;
    pointer-events: none;
    &>i {
        width: @20px;
        height: @20px;
        display: flex;
        justify-content: center;
        align-items: center;
        position: relative;
        margin-right: @16px;
        &.disabled {
            display: none;
        }
        &.hide {
            opacity: 0.4;
        }
        &:last-child {
            margin: 0;
        }

        img {
            width: 100%;
            height: 100%;
        }
    }
}

.boom-playlist-shadow {
    position: absolute;
    width: 100%;
    height: @300px - @10px;
    background: linear-gradient(180deg, rgba(20, 27, 31, 0) 0%, #141B1F 100%);
    opacity: 0.67;
    bottom: 0;
    left: 0;
    z-index: 100;
    pointer-events: none;
}
.boom-playlist-clear {
    width: 100%;height: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    img {
        width: @50px;
        height: auto;
        margin-bottom: @24px;
    }
    p {
        text-align: center;
        font-size: @18px;
        line-height: 140%;
        color: #FFFFFF;
        opacity: 0.7;
    }
}
.boom-playlist-list-wrapper {
    height: 100%;
    width: 100%;
    display: flex;
    flex-direction: column;
    align-items: flex-start;
    justify-content: flex-start;
    position: relative;

    .boom-playlist-id {
        width: 100%;
        height: @56px;
        padding-left: @20px;
        display: flex;
        align-items: center;
        justify-content: space-between;
        border-bottom: @1px solid rgba(255, 255, 255, 0.05);
        &>div {
            display: flex;
            align-items: center;
            justify-content: space-between;
            width: 100%;
            padding-right: @20px;
            &>p {
                font-weight: normal;
                font-size: @14px;
                line-height: 100%;
                text-transform: uppercase;
                color: #FFFFFF;
                opacity: 0.2;
                &.bp-id {
                    font-weight: bold;
                    font-size: @18px;
                    line-height: 100%;
                    opacity: 1;
                    text-align: right;
                    color: #FFFFFF;
                }
            }
        }
        &>button {
            width: @56px;
            height: @56px;
            display: flex;
            align-items: center;
            justify-content: center;
            border-left: @1px solid rgba(255, 255, 255, 0.05);
            height: 100%;
            img {
                width: @20px;
                height: @20px;
                opacity: .4;
                .anim;
            }

            &:hover {
                img {
                    opacity: .8;
                }
            }

            &:active {
                img {
                    position: relative;
                    top: @2px;
                }
            }
        }
    }


    .boom-playlist-list {
        width: 100%;
        height: 100%;
        overflow: auto;
        padding: 0 !important;

        &::-webkit-scrollbar {
            width: 0px !important;
            height: 0 !important;
        }

        &::-webkit-scrollbar-track {
            background: transparent !important;
            -webkit-border-radius: 0px !important;
            border-radius: 0px !important;
        }

        &::-webkit-scrollbar-thumb {
            -webkit-border-radius: 0px !important;
            border-radius: 0px !important;
            background: transparent !important;
        }

        &::-webkit-scrollbar-thumb:window-inactive {
            background: transparent !important;
        }
        .bp-item-wrap {
            position: relative;

            &.play-item {
                .bp-item {
                    padding-left: @56px;
                    &:before {
                        content: '';
                        width: @16px;
                        height: @16px;
                        background: url(./images/play-music.gif) no-repeat;
                        background-size: 100% 100%;
                        position: absolute;
                        left: @20px;
                        top: 50%;
                        transform: translateY(-50%);
                        z-index: 90;
                    }
                    &::after {
                        opacity: .5;
                    }
                }
            }
            &:hover {
                .bp-position {
                    opacity: 1;
                }
            }
            .bp-position {
                position: absolute;
                right: 0;
                top: 0;
                height: 100%;
                width: @36px;
                display: flex;
                flex-direction: column;
                align-items: center;
                justify-content: center;
                .anim;
                z-index: 60;
                opacity: 0;

                button {
                    width: 100%;
                    height: 50%;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                    &:first-child {
                        border-bottom: @1px solid rgba(255, 255, 255, 0.05);
                    }
                    img {
                        width: @20px;
                        height: @20px;
                        .anim;
                        opacity: .2;
                    }
                    &:not(:disabled):hover {
                        img {
                            opacity: .6;
                        }
                    }
                    &:not(:disabled):active {
                        img {
                            position: relative;
                            top: @1px;
                        }
                    }
                }
            }
            .disabled {
                display: none;
            }
            .bp-delete {
                position: absolute;
                right: @30px;
                z-index: 60;
                top: 50%;
                transform: translateY(-50%);
                button {
                    width: @30px;
                    height: @30px;
                    .anim;
                    opacity: .4;
                    img {
                        width: @20px;
                        height: @20px;
                    }
                    &:hover {
                        opacity: 4;
                    }
                    &:active {
                        img {
                            position: relative;
                            top: @2px;
                        }
                    }
                }
            }
        }
    }
}

