            font-size: @18px;
            line-height: 100%;
            color: #FFFFFF;
            margin-bottom: @10px;
            position: relative;
            z-index: 50;
        }
        .bbp-comp-time {
            font-weight: normal;
            font-size: @16px;
            line-height: 100%;
            color: #FFFFFF;
            opacity: 0.4;
            position: relative;
            z-index: 50;
            margin: 0;
        }
    }
    .bbp-management {
        width: 100%;
        display: flex;
        align-items: center;
        justify-content: flex-end;
        &>button {
            width: @48px;
            height: @48px;
            border-radius: 50%;
            display: flex;
            align-items: center;
            justify-content: center;
            margin-left: @18px;
            position: relative;
            .anim;
            img {
                width: @20px;
                height: @20px;
                .anim;
            }
            &:after {
                content: '';
                position: absolute;
                left: 0;
                top: 0;
                width: 100%;
                height: 100%;
                background: radial-gradient(50% 50% at 50% 50%, #FFFFFF 0%, rgba(255, 255, 255, 0) 100%);
                opacity: 0;
                .anim;
            }
            &:first-child {
                margin: 0;
            }
            &:hover {
                //background: rgba(16, 19, 20, 0.5);
                &::after {
                    opacity: 0.08;
                }
            }
            &:active {
                position: relative;
                top: @2px;
            }
            &.on {
                img {
                    opacity: 1;
                }
            }
            &.off {
                img {
                    opacity: .3;
                }
            }
            &.bbp-play {
                background: rgba(16, 19, 20, 0.5);
                &:hover {
                    background: #F04D26;
                }
            }
        }
    }
}

.volume {
    display: flex;
    align-items: center;
    justify-content: flex-end;
    margin-left: @50px;
    img {
        width: @20px;
        height: @20px;
        margin-left: @32px;
    }
    .volume-size {
        position: relative;
        width: @250px + @2px;
        height: @6px;
        background: rgba(16, 19, 20, 0.5);
        border-radius: @30px;
        cursor: pointer;
        i {
            position: absolute;
            left: 0;
            top: 0;
            height: 100%;
            background: #FFFFFF;
            box-shadow: 0px 0px @38px rgba(255, 255, 255, 0.3);
            border-radius: @30px;
            width: 44%;
            height: 100%;
        }
    }
}
